import React, {Component} from 'react'
import styled from 'styled-components'
const Section = styled.section``
const FirstView = styled.div`
  display: flex;
  height: 100vw;
  margin-top: 7vh;
  width: 50vw;
`
const FirstViewLeft = styled.div`
  margin-left: 5vw;
`

const TitleText = styled.p`
  font-weight: bold;
  font-size: 32px;
  line-height: 120%;
  /* or 38px */

  /* Black */

  color: #242728;
`
const TitleSubText1 = styled.p`
font-style: normal;
font-weight: 500;
font-size: 14px;
line-height: 20px;
/* identical to box height, or 125% */

letter-spacing: 0.5px;

/* Green */

color: black;
`
const FormDiv = styled.div`
display: flex;
height: 100vw;
margin-top: 7vh;
width: 50vw;
`
const FormTitle = styled.div`
font-weight: bold;
font-size: 20px;
line-height: 120%;
/* or 38px */

/* Black */

color: #242728;
`
class About extends Component {
  render() {
  return (
    <Section>
    <FirstView>
      <FirstViewLeft>
        <TitleText>Review your information</TitleText>
        <TitleSubText1>Complete your profile with your business details and basic information</TitleSubText1>
      </FirstViewLeft>

    </FirstView>
    <FormDiv>
    <FormTitle>Company Name</FormTitle>
    </FormDiv>
</Section>
  )
}
}
export default About;
